import { Fragment } from 'react';
import { Outlet } from 'react-router-dom';



import {
  NavigationContainer,
  NavLinks,
  NavLink,
  
} from './navbar.styles';

const NavBar = () => {
  
  return (
    <Fragment>
      <NavigationContainer>
        <NavLinks>
          <NavLink to='/myworkout'>My Workout</NavLink>
		  <NavLink to='/workoutplanner'>
		  <a target="_blank" href="https://icons8.com/icon/WWIRij774QJt/name">Name</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a>
		  </NavLink>
		  <NavLink to='/workoutplanner'>Workouts</NavLink>
        </NavLinks>
      </NavigationContainer>
      <Outlet />
    </Fragment>
  );
};

export default NavBar;
